import React from "react";

export default function Result(props) {
  const url = `https://inspct.career.go.kr/inspct/api/psycho/report?seq=${props.location.state.url}`;

  function fetchResult() {
    axios
      .get(
        "http://www.career.go.kr/inspct/openapi/test/questions?apikey=5894ecf675f64f28cd358b417ed6ad1b&q=6"
      )
      .then((response) => {
        const data = response.data.RESULT;
        setData(data);
      })
      .catch((Error) => {
        console.log(Error);
      });
  }
  useEffect(() => {
    fetchResult();
  }, []);

  useEffect(() => {
    if (data) {
      let resArr = [];
      data.map(() => {
        resArr.push("");
      });
      setResponse(resArr);
    }
  }, [data]);
  return <div>결과표페이지 만들자!</div>;
}
